    }, []);

    return (
        <div>
            <h1>Leaderboard</h1>
            <table className="table">
                <thead>
                    <tr>
                        <th>RANK</th>
                        <th>TEAM NAME</th>
                        <th>TOTAL GAMES PLAYED</th>
                        <th>SCORE</th>
                    </tr>
                </thead>
                <tbody>
                    {teams.map((team, index) => (
                        <tr key={team._id || index}>
                            <td>{index + 1}</td>
                            <td>{team.name}</td>
                            <td>{team.gamesPlayed}</td>
                            <td>{team.score}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

export default Leaderboard;
